export const generateReactiveFn = (
  doc: any,
  meta?: Object,
  readOnly?: boolean,
  updateFn?: Function,
  backend?: any,
  stream?: Function,
  sessionId?: string
): Object =>
  new Doc(doc, [], !!readOnly, updateFn, meta, backend, stream, sessionId);

